import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Locate and click the Electronics category card
    const electronicsCategorySelector = 'div.category-card:has-text("Electronics")';
    await page.waitForSelector(electronicsCategorySelector, { timeout: 5000 });
    const electronicsCard = page.locator(electronicsCategorySelector);
    await electronicsCard.click();

    // Take screenshot after clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_clicked_electronics.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_clicked_electronics.png'));

    // Since this is a static page, we can't verify navigation.
    // The success is based on the ability to find and click the element.
    const clickedElementText = await electronicsCard.innerText();

    return {
      success: true,
      action: "Successfully clicked on the Electronics category card.",
      extractedData: {
        clickedElementContent: clickedElementText.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to the Electronics category.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
